    <div style={{
            display: "flex",
            width: "50%",
            justifycontent: "flex-start"

    }}>

        <Link href='/'>
            <a style={linkStyle}>Home</a>
        </Link>

        <Link style={linkStyle} href="/about">
            <a style={linkStyle}>About</a>
        </Link>

    </div>
);

